  input: TEXT,"F3XN","","The Committee disclosed payments for Salaries/Wages for this
    period on Schedule H4 for Line 21a, and Schedule B for Line 30b.  The Committee
    pays its employees with 100% federal funds, and disclosed the expenditures on
    Line 30b when the individual spends more than 25% of their compensated time in
    a given month on Federal election activity or activities in connection with a
    Federal election.  Those individuals who spend 25% or less of their compensated
    time in a given month on Federal election activity or activities in connection
    with a Federal election are paid with Federal funds, and allocated on Schedule
    H4.  In either case, all amounts spent for employee specific 'fringe benefits,'
    consisting of health insurance, disability insurance, life insurance, retirement
    benefits and payroll taxes are paid for, and reported on a proportional basis
    equal to the amount associated with the individual that received the compensation
    and the funds with which the individual was paid.  Any reimbursements/allocation
    transfers to the Committee's federal account from the Committee's non-federal
    account for salaries, and/or benefits are associated with individuals whose activities
    do not exceed 25% in a given month.  Receipts reported on Schedule A for Line
    17, unless otherwise noted, are for the purchase of access to the Committee's
    voter file or specific lists generated from that file.  The Committee believes
    that this price properly reflects the fair market value of the file, which represents
    the normal charge for such date in our state.  All costs associated with the voter
    file are paid 100% out of the federal account and are therefore not allocable."
